/*Table structure for table `wy_card` */

DROP TABLE IF EXISTS `wy_card`;

CREATE TABLE `wy_card` (
  `card_id` bigint(20) NOT NULL COMMENT '主键',
  `epc_id` varchar(30) DEFAULT NULL COMMENT '物理卡号',
  `card_no` varchar(30) NOT NULL COMMENT '逻辑卡号',
  `card_type` varchar(30) NOT NULL COMMENT '卡类型：1（卡片）2（身份证）3（银行卡）',
  `bind_status` int(11) NOT NULL DEFAULT '0' COMMENT '绑定状态：0（未使用）1（已使用）',
  `data_status` int(11) NOT NULL DEFAULT '0' COMMENT '是否启用：0（失效）1（启用） ',
  `area_id` int(11) NOT NULL COMMENT '小区ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `validity_time` datetime DEFAULT NULL COMMENT '有效期',
  `last_update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `bind_user_phone` varchar(20) DEFAULT '' COMMENT '绑定用户手机号',
  `bind_user_id` bigint(20) DEFAULT NULL COMMENT '绑定用户id',
  `extra_desc` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`card_id`),
  UNIQUE KEY `epc_id` (`epc_id`) USING BTREE
