/*Table structure for table `wy_face_access_device` */

DROP TABLE IF EXISTS `wy_face_access_device`;

CREATE TABLE `wy_face_access_device` (
  `device_id` varchar(50) NOT NULL DEFAULT '' COMMENT '设备编号',
  `device_name` varchar(50) DEFAULT NULL COMMENT '设备名称',
  `device_type_id` varchar(20) DEFAULT NULL COMMENT '设备类型编码（1001单屏,2001闸机,3001桌面双屏,4001门禁,5001摄像头）',
  `connect_status` int(11) DEFAULT NULL COMMENT '连接状态（1联网，2断网）',
  `activate_status` int(11) DEFAULT NULL COMMENT '激活状态（0未激活，1激活）',
  `device_ip` varchar(20) DEFAULT NULL COMMENT '设备ip',
  `access_area_id` varchar(50) DEFAULT NULL COMMENT '设备所属区域id',
  `access_area_name` varchar(50) DEFAULT NULL COMMENT '设备所属区域名称',
  `device_port` varchar(10) DEFAULT NULL COMMENT '设备端口',
  `device_version` varchar(20) DEFAULT NULL COMMENT '设备版本名称',
  `device_version_code` varchar(50) DEFAULT NULL COMMENT '设备版本号',
  `device_sn` varchar(50) DEFAULT NULL COMMENT '设备sn号',
  `create_time` datetime DEFAULT NULL COMMENT '设备创建时间',
  `tenant_id` varchar(50) DEFAULT NULL COMMENT '设备所属租户id',
  `device_type_name` varchar(50) DEFAULT NULL COMMENT '设备类型名称',
  `device_face_threshold` varchar(20) DEFAULT NULL COMMENT '设备人脸检测阈值',
  `del_flag` int(11) DEFAULT NULL COMMENT '是否已删除（0正常，1删除）',
  `bandwidth` int(11) DEFAULT NULL COMMENT '带宽，单位：mb/s',
  `storage` float DEFAULT NULL COMMENT '存储容量：GB',
  `activate_time` datetime DEFAULT NULL COMMENT '激活时间',
  `manufacture` varchar(50) DEFAULT NULL COMMENT '制造商',
  `mage_date` varchar(20) DEFAULT NULL COMMENT '出厂日期',
  `org_id` varchar(20) DEFAULT NULL COMMENT '组织id',
  `upgrade_pack_status` int(11) DEFAULT NULL COMMENT '升级包状态（0无升级包，1有升级包）',
  `upgrade_progress` int(11) DEFAULT NULL COMMENT '升级状态（0可升级、1正在下载，2升级，3升级等待，4正在升级，5暂停下载）',
  `area_id` int(11) DEFAULT NULL COMMENT '小区ID',
  `data_status` int(11) DEFAULT '0' COMMENT '数据状态',
  PRIMARY KEY (`device_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

