/*Table structure for table `wy_person_access_record` */

DROP TABLE IF EXISTS `wy_person_access_record`;

CREATE TABLE `wy_person_access_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `tenant_id` varchar(50) DEFAULT NULL COMMENT '租户ID',
  `user_id` varchar(50) DEFAULT NULL COMMENT '常客用户id',
  `type` varchar(1) DEFAULT NULL COMMENT '进出类型：0进 1出',
  `ic_number` varchar(20) DEFAULT NULL COMMENT 'IC卡号',
  `image_uri` varchar(500) DEFAULT NULL COMMENT '用户注册时的照片地址',
  `sysc_time` datetime NOT NULL COMMENT '识别时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `identify` varchar(1) DEFAULT NULL COMMENT '0人脸识别 、1 ic卡识别',
  `user_phone` varchar(20) DEFAULT NULL COMMENT '用户电话',
  `device_sn` varchar(50) DEFAULT NULL COMMENT '设备SN号',
  `user_name` varchar(20) DEFAULT NULL COMMENT '用户姓名',
  `device_name` varchar(100) DEFAULT NULL COMMENT '设备名称',
  `organization_name` varchar(50) DEFAULT NULL COMMENT '组织名称',
  `organization_id` varchar(50) DEFAULT NULL COMMENT '组织ID',
  `visible_light_pic` varchar(500) DEFAULT NULL COMMENT '识别抓拍照片的地址',
  `near_infrared_pic` varchar(500) DEFAULT NULL COMMENT '识别抓拍的近红外照片地址',
  `account_id` varchar(50) DEFAULT NULL COMMENT '子帐号ID',
  `employee_number` int(11) DEFAULT NULL COMMENT '用户工号',
  `device_id` varchar(50) DEFAULT NULL COMMENT '设备ID',
  `attendance_flag` int(11) DEFAULT NULL COMMENT '是否作为考勤使用：0否  1是',
  `result_type` varchar(1) DEFAULT NULL COMMENT '识别结果：0成功  1失败',
  `reject_reason` varchar(50) DEFAULT NULL COMMENT '识别错误的原因',
  `device_type` varchar(10) DEFAULT NULL COMMENT '设备类型：1001单屏、2001闸机、3001桌面双屏、4001门禁、5001摄像头',
  `device_type_name` varchar(50) DEFAULT NULL COMMENT '设备类型名称',
  `access_area_name` varchar(50) DEFAULT NULL COMMENT '区域名称',
  `access_area_id` varchar(50) DEFAULT NULL COMMENT '区域ID',
  `idcard_number` varchar(50) DEFAULT NULL COMMENT '身份证',
  `area_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2997 DEFAULT CHARSET=utf8;

