/*Table structure for table `wy_time_segment` */

DROP TABLE IF EXISTS `wy_time_segment`;

CREATE TABLE `wy_time_segment` (
  `segment_id` varchar(50) NOT NULL DEFAULT '' COMMENT '时间段ID',
  `segment_name` varchar(50) DEFAULT NULL COMMENT '时间段名称',
  `segment_desc` varchar(100) DEFAULT NULL COMMENT '时间段描述',
  `day1_start` varchar(8) DEFAULT NULL COMMENT '开始时间周一',
  `day2_start` varchar(8) DEFAULT NULL COMMENT '开始时间周二',
  `day3_start` varchar(8) DEFAULT NULL COMMENT '开始时间周三',
  `day4_start` varchar(8) DEFAULT NULL COMMENT '开始时间周四',
  `day5_start` varchar(8) DEFAULT NULL COMMENT '开始时间周五',
  `day6_start` varchar(8) DEFAULT NULL COMMENT '开始时间周六',
  `day7_start` varchar(8) DEFAULT NULL COMMENT '开始时间周日',
  `day1_end` varchar(8) DEFAULT NULL COMMENT '结束时间周一',
  `day2_end` varchar(8) DEFAULT NULL COMMENT '结束时间周二',
  `day3_end` varchar(8) DEFAULT NULL COMMENT '结束时间周三',
  `day4_end` varchar(8) DEFAULT NULL COMMENT '结束时间周四',
  `day5_end` varchar(8) DEFAULT NULL COMMENT '结束时间周五',
  `day6_end` varchar(8) DEFAULT NULL COMMENT '结束时间周六',
  `day7_end` varchar(8) DEFAULT NULL COMMENT '结束时间周日',
  `code` varchar(20) DEFAULT NULL COMMENT '权限码',
  PRIMARY KEY (`segment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

