/*Table structure for table `wy_unlock_record` */

DROP TABLE IF EXISTS `wy_unlock_record`;

CREATE TABLE `wy_unlock_record` (
  `unlock_record_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '主键',
  `unlock_time` datetime DEFAULT NULL COMMENT '开锁时间',
  `unlock_type` tinyint(4) DEFAULT NULL COMMENT '开锁类型: 1-人脸识别 2-蓝牙开锁 3-远程开锁 4-二维码 5-其它',
  `unlock_card_no` varchar(255) DEFAULT NULL COMMENT '开锁卡号',
  `auth_user_id` bigint(20) DEFAULT NULL COMMENT '授权用户ID',
  `auth_type` tinyint(4) DEFAULT NULL COMMENT '授权类型: 1-本人授权 2-访客授权 3-其它',
  `unlock_user_phone` varchar(255) DEFAULT NULL COMMENT '出入人手机号',
  `unlock_user_name` varchar(255) DEFAULT NULL COMMENT '出入人姓名',
  `area_id` bigint(20) DEFAULT NULL COMMENT '小区ID',
  `area_name` varchar(255) DEFAULT NULL COMMENT '小区名称',
  `building_id` bigint(20) DEFAULT NULL COMMENT '楼栋ID',
  `building_name` varchar(255) DEFAULT NULL COMMENT '楼栋名称',
  `cell_id` bigint(20) DEFAULT NULL COMMENT '单元ID',
  `cell_name` varchar(255) DEFAULT NULL COMMENT '单元名称',
  `access_id` bigint(20) DEFAULT NULL COMMENT '门禁ID',
  `access_name` varchar(255) DEFAULT NULL COMMENT '门禁名称',
  `extra_desc` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`unlock_record_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `wy_unlock_record` */

/*Table structure for table `wy_visitor` */

DROP TABLE IF EXISTS `wy_visitor`;

CREATE TABLE `wy_visitor` (
  `visitor_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '访客ID',
  `visitor_type` int(11) DEFAULT '1' COMMENT '访客类型：1-人脸 2-二维码 3-密码',
  `visitor_person_id` varchar(50) DEFAULT NULL COMMENT '访客平台ID',
  `visitor_name` varchar(50) DEFAULT NULL COMMENT '访客名称',
  `visitor_phone` varchar(11) DEFAULT NULL COMMENT '访客电话',
  `visitor_visible_light_pic` varchar(200) DEFAULT NULL COMMENT '访客照片',
  `area_id` int(11) DEFAULT NULL COMMENT '区域ID',
  `person_id` varchar(50) DEFAULT NULL COMMENT '业主平台帐号',
  `user_id` bigint(20) DEFAULT NULL COMMENT '业主用户ID',
  `room_id` bigint(20) DEFAULT NULL COMMENT '房间ID',
  `room_addr` varchar(200) DEFAULT NULL COMMENT '房间地址',
  `room_mask` varchar(50) DEFAULT NULL COMMENT '房间掩码',
  `key_data` varchar(200) DEFAULT NULL COMMENT '开锁密钥',
  `start_valid_date` datetime DEFAULT NULL COMMENT '开始时间',
  `end_valid_date` datetime DEFAULT NULL COMMENT '结束时间',
  `data_status` int(4) DEFAULT NULL COMMENT '数据状态',
  `sync_status` int(4) DEFAULT NULL COMMENT '同步状态',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `extra_desc` varchar(200) DEFAULT NULL COMMENT '扩展参数',
  `access_area_ids` varchar(500) DEFAULT NULL COMMENT '访问区域（保留）',
  `segment_ids` varchar(200) DEFAULT NULL COMMENT '访问时间（保留）',
  PRIMARY KEY (`visitor_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

