/*Table structure for table `wy_visitor_access_record` */

DROP TABLE IF EXISTS `wy_visitor_access_record`;

CREATE TABLE `wy_visitor_access_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `device_sn` varchar(50) DEFAULT NULL COMMENT '设备SN号',
  `device_id` varchar(50) DEFAULT NULL COMMENT '设备ID',
  `device_name` varchar(50) DEFAULT NULL COMMENT '设备名称',
  `tenant_id` varchar(50) DEFAULT NULL COMMENT '租户ID',
  `type` varchar(1) DEFAULT NULL COMMENT '进出类型：0进 1出',
  `account_id` varchar(50) DEFAULT NULL COMMENT '子帐号ID',
  `user_type` varchar(1) DEFAULT NULL COMMENT '用户类型 : 1访客（预约/临时），2新访客，3黑名单',
  `visitor_type` varchar(1) DEFAULT NULL COMMENT '访客类型：1客户、2待办',
  `apply_flag` varchar(1) DEFAULT NULL COMMENT '是否是访问单的访客：0不是 1是',
  `record_id` varchar(50) DEFAULT NULL COMMENT '访问单单号，仅在applyFlag=1时有效',
  `pass_mode` varchar(1) DEFAULT NULL COMMENT '通行方式：0人脸，1IC卡，2身份证',
  `visible_light_pic` varchar(500) DEFAULT NULL COMMENT '识别抓拍的可见光照片',
  `near_infrared_pic` varchar(500) DEFAULT NULL COMMENT '识别抓拍的近红外照片',
  `sysc_time` datetime DEFAULT NULL COMMENT '识别时间',
  `create_time` datetime DEFAULT NULL COMMENT '上传时间',
  `name` varchar(50) DEFAULT NULL COMMENT '访客/访客身份证——姓名',
  `nation` varchar(100) DEFAULT NULL COMMENT '访客身份证——民族',
  `sex` varchar(5) DEFAULT NULL COMMENT '访客性别 0男1女',
  `birthday` datetime DEFAULT NULL COMMENT '访客身份证——生日',
  `address` varchar(300) DEFAULT NULL COMMENT '访客身份证——家庭住址',
  `idcard_number` varchar(50) DEFAULT NULL COMMENT '访客身份证号',
  `sign_org` varchar(50) DEFAULT NULL COMMENT '访客身份证——签发机关',
  `sign_begin` datetime DEFAULT NULL COMMENT '访客身份证——签发日期',
  `sign_end` datetime DEFAULT NULL COMMENT '访客身份证——到期时间',
  `idcard_image` varchar(500) DEFAULT NULL COMMENT '访客身份证——照片',
  `qr_code` varchar(500) DEFAULT NULL COMMENT '访客二维码',
  `result_type` varchar(1) DEFAULT NULL COMMENT '识别结果：0成功 1失败',
  `reject_reason` varchar(50) DEFAULT NULL COMMENT '失败原因',
  `device_type` varchar(10) DEFAULT NULL COMMENT '设备类型：1001单屏、2001闸机、3001桌面双屏、4001门禁、5001摄像头',
  `device_type_name` varchar(50) DEFAULT NULL COMMENT '设备类型名称',
  `access_area_name` varchar(50) DEFAULT NULL COMMENT '区域名称',
  `access_area_id` varchar(50) DEFAULT NULL COMMENT '区域ID',
  `area_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=utf8;

