DROP TABLE IF EXISTS `wy_visitor_record`;

CREATE TABLE `wy_visitor_record` (
  `visitor_record_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '主键',
  `visitor_name` varchar(50) DEFAULT NULL COMMENT '访客名称',
  `visitor_phone` varchar(20) DEFAULT NULL COMMENT '访客手机',
  `visitor_photo` varchar(500) DEFAULT NULL COMMENT '访客相片',
  `user_id` bigint(20) DEFAULT NULL COMMENT '受访用户ID',
  `user_phone` varchar(20) DEFAULT NULL COMMENT '受访用户手机',
  `area_id` bigint(20) DEFAULT NULL COMMENT '小区ID',
  `room_id` bigint(20) DEFAULT NULL COMMENT '房间ID',
  `room_name` varchar(200) DEFAULT NULL COMMENT '房间名称',
  `visitor_device_id` bigint(20) DEFAULT NULL COMMENT '访客机ID',
  `data_status` tinyint(4) DEFAULT NULL COMMENT '状态',
  `feedback` tinyint(4) DEFAULT NULL COMMENT '反馈结果',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `extra_desc` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`visitor_record_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

